import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import Routes from './routes';

ReactDOM.render(
    <Routes>
        <React.StrictMode>
            <App />
        </React.StrictMode>,
        document.getElementById('root')
    </Routes>
);
